

function load_page() {

    let content = document.getElementById('html-content');
    content.innerHTML = '';

    let img = document.createElement("img");
    img.src = 'screenshot462004.png';
    img.onload = function (){
        let scale = this.width/720;
        img.width = 720;
        img.height = img.naturalHeight/scale;
        content.appendChild(img);

        json.forEach(elem => {
            let new_elem = document.createElement('div');
            let x = Math.floor(parseInt(elem['x'])/scale);
            let y = Math.floor(parseInt(elem['y'])/scale);
            let width = Math.floor(parseInt(elem['width'])/scale+1);
            let height = Math.floor(parseInt(elem['height'])/scale+1);
            let z_index = elem['z-index'];

            new_elem.style = `top: ${y}px; left: ${x}px; width: ${width}px; height: ${height}px; z-index: ${z_index}; position: absolute; background: rgba(51, 170, 51, 0);`;
            new_elem.addEventListener('mouseover', function () {
                this.style.border = "2px solid green";
                this.style.boxSizing = "border-box";
            });
            new_elem.addEventListener('mouseout', function () {
                if (this.style.background === "rgba(51, 170, 51, 0) none repeat scroll 0% 0%") {
                    this.style.border = "none";
                }
            });
            new_elem.addEventListener('click', function () {
                if (this.style.background === "rgba(51, 170, 51, 0) none repeat scroll 0% 0%") {
                    this.style.background = "rgba(51, 170, 51, .2)";
                    this.style.border = "2px solid green";
                    this.style.boxSizing = "border-box";
                }
                else {
                    this.style.background = "rgba(51, 170, 51, 0) none repeat scroll 0% 0%";
                }
            });
            content.appendChild(new_elem);
        });
    };

}
